/**
 * Get TOC content for a specific version
 */
export function getTOCContent(version: string): string {
  switch (version) {
    case "6.1":
    case "6_1":
      return getTOC61();
    case "6.1.1":
    case "6_1_1":
      return getTOC611();
    case "5.13":
    case "5_13":
      return getTOC513();
    case "NextGen":
    case "NG":
      return getTOCNG();
    default:
      return getTOC61();
  }
}
